            <img
              className="workComponent"
              src={`/nNLOhm8Arl--1.gif`}
              key={index}
            />
          );
        })}
      </Dump>
      <style jsx>{`
        .workComponent {
          max-width: 425px;
        }
      `}</style>
    </div>
